import React from 'react';

const Fave = (props) => {

  const handleClick = (e) => {
    e.stopPropagation();
    props.handleSave();
    props.isFave();
  }

  const isFave = props.isFave ? 'remove_from_queue' : 'add_to_queue';

  return (
    <div onClick={handleClick}>
      <p>{isFave}</p>
    </div>
  );
};

export default Fave;
